import '../../assets/css/admin.css';
import React, { Component,Fragment } from 'react'
import {Container, Row, Col} from 'react-bootstrap';

export class adminSignIn extends Component {
  render() {
    return (
      <Fragment>
        <Container className='m-auto bg-white mt-5'>
            <h3 className='text-center'>Welcome to Applier Dashboard</h3>
            <p>E-Mail</p>
            <input className='inputStyling' type="email" name="" value="" placeholder='John123@gmail.com' />
        </Container>
      </Fragment>
    )
  }
}

export default adminSignIn
